Function Visuals {
 
    If ($BuildNumber -gt $WantedBuild) {
        write-Host " I have detected that you are on Windows 11 `n `n Applying appropriate theme"
        Start-BitsTransfer -Source "https://github.com/circlol/newload/raw/main/Assets/win11-light.deskthemepack" -Destination "$folder\win11-light.deskthemepack"
        #Start-BitsTransfer -Source "https://www40.zippyshare.com/d/ITnX1PTu/920358/win11-light.deskthemepack" -Destination win11-light.deskthemepack
        Start-Sleep 3
        Start-Process "$folder\win11-light.deskthemepack"
        $VISUALRUN = "Win11"
    } else {
        If ($BuildNumber -lt $WantedBuild) {
            write-Host " I have detected that you are on Windows 10 `n `nApplying appropriate Theme"
            Start-BitsTransfer -Source "https://github.com/circlol/newload/raw/main/Assets/win10-purple.deskthemepack" -Destination "$folder\win10-purple.deskthemepack"
            Start-Sleep 3

            #Start-Process "$folder\win10-purple.deskthemepack"
            Start-Process $win10path
            $VISUALRUN = "Win10"
        }
    }
    Write-Host "`n Setting Wallpaper to Stretch `n"
    REG ADD "HKCU\Control Panel\Desktop" /v WallpaperStyle /f /t REG_SZ /d "2"
	Start-Sleep 1
	taskkill /F /IM systemsettings.exe 2>$NULL


    If ($VISUALRUN -eq $10){
        Remove-Item -Path "$win10path" -Force -Recurse -ErrorAction SilentlyContinue
    } Else {
        If ($VISUALRUN -eq $11){
            Remove-Item -Path "$win11path" -Force -Recurse -ErrorAction SilentlyContinue            
        } Else {
            Write-Host Did not find the path specifed.
        }
    }
    #taskkill /F /IM explorer.exe 2>$NULL
}

Function StartMenu {
    Write-host "$frmt Applying Start Menu & Pinning Taskbar Layout $frmt"
    Write-Host " Creating StartMenuLayout.Xml"
    $START_MENU_LAYOUT = @"
<LayoutModificationTemplate xmlns:defaultlayout="http://schemas.microsoft.com/Start/2014/FullDefaultLayout" xmlns:start="http://schemas.microsoft.com/Start/2014/StartLayout" Version="1" xmlns:taskbar="http://schemas.microsoft.com/Start/2014/TaskbarLayout" xmlns="http://schemas.microsoft.com/Start/2014/LayoutModification">
    <LayoutOptions StartTileGroupCellWidth="6" />
    <DefaultLayoutOverride>
        <StartLayoutCollection>
            <defaultlayout:StartLayout GroupCellWidth="6" />
        </StartLayoutCollection>
    </DefaultLayoutOverride>
    <CustomTaskbarLayoutCollection PinListPlacement="Replace">
        <defaultlayout:TaskbarLayout>
        <taskbar:TaskbarPinList>
            <taskbar:DesktopApp DesktopApplicationID="Chrome" />
            <taskbar:DesktopApp DesktopApplicationID="Microsoft.Windows.Explorer" />
            </taskbar:TaskbarPinList>
        </defaultlayout:TaskbarLayout>
    </CustomTaskbarLayoutCollection>
</LayoutModificationTemplate>
"@
    
    $layoutFile="C:\Windows\StartMenuLayout.Xml"
    If(Test-Path $layoutFile)
    {
        Remove-Item $layoutFile
    }
    $START_MENU_LAYOUT | Out-File $layoutFile -Encoding ASCII
    $regAliases = @("HKLM", "HKCU")
    foreach ($regAlias in $regAliases){
        $basePath = $regAlias + ":\SOFTWARE\Policies\Microsoft\Windows"
        $keyPath = $basePath + "\Explorer" 
        IF(!(Test-Path -Path $keyPath)) { 
            New-Item -Path $basePath -Name "Explorer"
        }
        Set-ItemProperty -Path $keyPath -Name "LockedStartLayout" -Value 1
        Set-ItemProperty -Path $keyPath -Name "LockedStartLayout" -Value 1
        Set-ItemProperty -Path $keyPath -Name "StartLayoutFile" -Value $layoutFile
    }
    Write-Host " Restarting Explorer Service"
    Stop-Process -name explorer -force | Out-Null 2>$NULL
    Start-Sleep -s 3
    $wshell = New-Object -ComObject wscript.shell; $wshell.SendKeys('^{ESCAPE}')
    Start-Sleep -s 3
    Write-Host " Locking Start Menu Layout"
    foreach ($regAlias in $regAliases){
        $basePath = $regAlias + ":\SOFTWARE\Policies\Microsoft\Windows"
        $keyPath = $basePath + "\Explorer" 
        Set-ItemProperty -Path $keyPath -Name "LockedStartLayout" -Value 0
    }
    Write-Host " Clearing Pinned Start Icons"
    Stop-Process -name explorer -force | Out-Null 2>$NULL
    Write-Host " Applying Taskbar Icons"
    Import-StartLayout -LayoutPath $layoutFile -MountPath $env:SystemDrive\
    Write-Host " Applied Taskbar Icons"
    Write-Host " Removing layout.xml files "
    Remove-Item $layoutFile
    taskkill /F /IM explorer.exe | Out-Null 2>$NULL
}
Function UndoOneDrive{
    Write-Host "$frmt Starting OneDriveSetup.exe $frmt"
    $onedrivelocation = "$env:SystemRoot\SysWOW64\OneDriveSetup.exe"
    Write-Host " Starting $onedrivelocation"
    Start-Process $onedrivelocation /Silent -Wait
    If (!(Test-Path "HKLM:\SOFTWARE\Policies\Microsoft\Windows\OneDrive")) {
        New-Item -Path "HKLM:\SOFTWARE\Policies\Microsoft\Windows\OneDrive" | Out-Null 2>$NULL
    }
    Set-ItemProperty -Path "HKLM:\SOFTWARE\Policies\Microsoft\Windows\OneDrive" -Name "DisableFileSyncNGSC" -Type DWord -Value 0
    Write-Host "`n `n OneDrive reinstalled."
}
Function OneDrive {
    Write-Host "`n$frmt `n Disabling OneDrive..."
    #If (!(Test-Path "HKLM:\SOFTWARE\Policies\Microsoft\Windows\OneDrive")) {
    #    New-Item -Path "HKLM:\SOFTWARE\Policies\Microsoft\Windows\OneDrive" | Out-Null 2>$NULL
    #}
    #Set-ItemProperty -Path "HKLM:\SOFTWARE\Policies\Microsoft\Windows\OneDrive" -Name "DisableFileSyncNGSC" -Type DWord -Value 1
    Stop-Process -Name "OneDrive" -ErrorAction SilentlyContinue
    Start-Sleep -s 2
    Write-Host " Uninstalling OneDrive..."
    $onedrive = "$env:SYSTEMROOT\SysWOW64\OneDriveSetup.exe"
    If (!(Test-Path $onedrive)) {
        $onedrive = "$env:SYSTEMROOT\System32\OneDriveSetup.exe"
    }
    Start-Process $onedrive "/uninstall" -NoNewWindow -Wait
    Start-Sleep -s 2
    Stop-Process -Name "explorer" -ErrorAction SilentlyContinue
    Start-Sleep -s 2
    Remove-Item -Path "$env:USERPROFILE\OneDrive" -Force -Recurse -ErrorAction SilentlyContinue
    Remove-Item -Path "$env:LOCALAPPDATA\Microsoft\OneDrive" -Force -Recurse -ErrorAction SilentlyContinue
    Remove-Item -Path "$env:PROGRAMDATA\Microsoft OneDrive" -Force -Recurse -ErrorAction SilentlyContinue
    Remove-Item -Path "$env:SYSTEMDRIVE\OneDriveTemp" -Force -Recurse -ErrorAction SilentlyContinue
